package com.sit.dto;

public class UserDTO {

	private Integer moduleId;

	private String userName;

	private String password;

	private Integer roleId;

	private String name;

	private Integer enrolled;

	private Integer statusLevelI;

	private Integer statusLevelII;

	private Integer statusLevelIII;

	public UserDTO() {
		// TODO Auto-generated constructor stub
	}

	public Integer getModuleId() {
		return moduleId;
	}

	public void setModuleId(Integer moduleId) {
		this.moduleId = moduleId;
	}

	public String getUserName() {
		return userName;
	}

	public void setUserName(String userName) {
		this.userName = userName;
	}

	public String getPassword() {
		return password;
	}

	public void setPassword(String password) {
		this.password = password;
	}

	public Integer getRoleId() {
		return roleId;
	}

	public void setRoleId(Integer roleId) {
		this.roleId = roleId;
	}

	public String getName() {
		return name;
	}

	public void setName(String name) {
		this.name = name;
	}

	public Integer getEnrolled() {
		return enrolled;
	}

	public void setEnrolled(Integer enrolled) {
		this.enrolled = enrolled;
	}

	public Integer getStatusLevelI() {
		return statusLevelI;
	}

	public void setStatusLevelI(Integer statusLevelI) {
		this.statusLevelI = statusLevelI;
	}

	public Integer getStatusLevelII() {
		return statusLevelII;
	}

	public void setStatusLevelII(Integer statusLevelII) {
		this.statusLevelII = statusLevelII;
	}

	public Integer getStatusLevelIII() {
		return statusLevelIII;
	}

	public void setStatusLevelIII(Integer statusLevelIII) {
		this.statusLevelIII = statusLevelIII;
	}

}
